import React from 'react';

const About = () => {
	return (
		<>
			<div>
				<form method=''>
					<div className='row'>
						<div className='col-md-4'></div>
						<div className='col-md-6'>
							<h5>Mudra Suthar</h5>
							<h6>Web Developer</h6>
							<p className='mt-3 mb-5'>Rankings :: 1/10</p>
						</div>
					</div>
				</form>
			</div>
		</>
	);
};

export default About;
